import React from "react";
import Wrapper from "../assets/wrappers/BigSidebar";

const BigSidebar = () => {
  return <Wrapper>
    <div>
        <ul>
            <li>
                <span>
                    <a></a>
                </span>
            </li>
        </ul>
    </div>
  </Wrapper>;
};

export default BigSidebar;
